import React from 'react';
import styled from 'styled-components/native';
import { TouchableOpacity, StyleSheet, Image } from 'react-native';

import { MaterialCommunityIcons } from '@expo/vector-icons';
import { FontAwesome5 } from '@expo/vector-icons';
import { FontAwesome } from '@expo/vector-icons';

import Logon from '../assets/GreenLogo.png';


const Explore = ({ navigation }) => {

    return (
        <>
            <Main>
            <HeaderContainer>
                    <Image source={Logon} style={styles.logo} />
                </HeaderContainer>

            </Main>

            <FooterContainer> 
            <Icon>
            <TouchableOpacity onPress={() => navigation.navigate('Diary')}>
                <MaterialCommunityIcons name="fountain-pen-tip" size={40} color="#ABA97B" />
                <Text>Dagbok</Text>
                </TouchableOpacity>
            </Icon>
            <Icon> 
            <TouchableOpacity onPress={() => navigation.navigate('Explore')}>
                <FontAwesome5 name="readme" size={40} color="#5A673E" />
                <Text>Utforska</Text>
                </TouchableOpacity>
            </Icon>

            <Icon>
            <TouchableOpacity onPress={() => navigation.navigate('Statistics')}>
                <FontAwesome name="bar-chart" size={40} color="#ABA97B" />
                <Text>Statestik</Text>
                </TouchableOpacity>
            </Icon>

            <Icon>
            <TouchableOpacity onPress={() => navigation.navigate('Profile')}>
                <FontAwesome name="child" size={40} color="#ABA97B" onPress={() => navigation.navigate('Profile')}  />
                <Text>Profil</Text>
                </TouchableOpacity>
            </Icon> 
            </FooterContainer>
        </>
    )
}


const styles = StyleSheet.create({
    logo: {
        height: 490,
        width: 400,
    }
})

const Main = styled.View`
flex: 1;
background-color:#5A673E;
`

const HeaderContainer = styled.View`
width: 100%;
border: solid white 2px;
`

const FooterContainer = styled.View`
margin-top: 0px;
height: 100px;
width: 100%;
flex-direction:row;
align-items: center;
justify-content: space-evenly;
`
const Text = styled.Text`
font-size: 15px;
`

const Icon = styled.View`
align-items: center;
`

export default Explore
